import React from "react";
import { Grid } from "@material-ui/core";
import ServicesData from "./ServicesData";
import Card from "./Card";

const Services = () => {
    return(
        <React.Fragment>
            {ServicesData.map((val) => {
                return(
                    <Card
                    icon = {val.icon}
                    service = {val.service}
                    discription = {val.discription}
                    />
                );
            })}
        </React.Fragment>
    );
}

export default Services;
